import Button from "../elements/Button";

export default function BrandIcon() {
  return (
    <Button className="" type="link" href="/">
      <p className="text-theme-blue text-4xl font-medium ">
        GMT
        <span className="text-[#EAAE37]">solution</span>
      </p>
    </Button>
  );
}
